import React from "react";
import Entry from "./Entry";
import emojipedia from "../emojipedia";


const array1 = [
    {
      about :"Typical smiley face with open mouth and oval eyes. Is in a positive mood, shows its teeth and laughs cheerfully. Expresses enthusiasm: from a cheerful greeting to boundless joy."
  },
    
    {
      about :"Typical smiley face with open mouth and oval eyes. Is in a positive mood, shows its teeth and laughs cheerfully. Expresses enthusiasm: from a cheerful greeting to boundless joy."
  },
    
    {
      about :"Typical smiley face with open mouth and oval eyes. Is in a positive mood, shows its teeth and laughs cheerfully. Expresses enthusiasm: from a cheerful greeting to boundless joy."
  },
 
 ]
var sortmsg = array1.map(function (array2){
return array2.about.substring(0, 100)
})

console.log(sortmsg);








function createEntry(entryTerm){
    return(
        <Entry 
            key = {entryTerm.id}
            emoji = {entryTerm.emoji}
            name = {entryTerm.name}
            description = {entryTerm.meaning}
        />
    )
}

function App(){
    return(
        <div>
            <h1>
                <span>emojipedia</span>
            </h1>
            <dl className="dictionary">
                {emojipedia.map(createEntry)}
            </dl>
        </div>
    )
}
export default App;
